using System;
using System.Collections.Generic;
using System.IO;
using System.IO.Compression;
using System.Text;

namespace TrainingDataCompressor
{
    public class ByteLoader
    {
        public static string hexString = @"";
        public static byte[] bytes = new byte[] { };

        public static BinaryReader LoadBytesToReader()
        {
            bytes = Convert.FromHexString(hexString);
            var compressedmemoryStream = new MemoryStream();
            var outputMemoryStream = new MemoryStream();

            using var decompressor = new GZipStream(compressedmemoryStream, CompressionMode.Decompress);
            decompressor.CopyTo(outputMemoryStream);

            return new BinaryReader(outputMemoryStream);
        }
    }
}
